import React from 'react';

const Countries = () => {
    const countries = [
        'country1.png',
        'country2.png',
        'country3.png',
        // Add more country image filenames here
    ];

    return (
        <div>
            <h1>Countries</h1>
            <div style={{ display: 'flex', flexWrap: 'wrap' }}>
                {countries.map((country, index) => (
                    <div key={index} style={{ margin: '10px' }}>
                        <img
                            src={`${process.env.PUBLIC_URL}/images/flags/${country}`}
                            alt={country}
                            style={{ width: '100px', height: 'auto' }}
                        />
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Countries;
